  true,\n\t\"url\": null,\n\t\"notes\": \"<p>As part of the Obama Administrations
  efforts to make our healthcare system more transparent, affordable, and accountable,
  the Centers for Medicare and Medicaid Services (CMS) has prepared a public data
  set, the Medicare Part D Opioid Prescriber Summary File, which presents information
  on the individual opioid prescribing rates of health providers that participate
  in Medicare Part D program.u00c2u00a0 This file is a prescriber-level data set that
  provides data on the number and percentage of prescription claims (includes new
  prescriptions and refills) for opioid drugs, and contains information on each providers
  name, specialty, state, and ZIP code. u00c2u00a0This summary file was derived from
  the 2013 Part D Prescriber Public Use File.u00c2u00a0</p>n\",\n\t\"license_title\":
